import React from 'react';
import { formatThousands } from '../../helper/formatter';
const InventoryInfo = (props) => {
  return (
    <div>
      <h5 className="font-size-14 font-bold" style={{ paddingLeft: '12px' }}>
        Inventory Info
      </h5>{' '}
      <div className="row">
        <div className="col-md-1 ml-4">
          <div className="info-icon">
            <i className="inventory-icon"></i>
          </div>
        </div>
        <div className="col-md-2">
          {' '}
          <div className="info-data">
            <p className="font-size-14 mb-0 font-normal">Total Inventory</p>
            <div className="info-numbers">
              {formatThousands(props.totalInventory)}
              {/* props.inventoryInfoData.data && props.inventoryInfoData.data.totalInv */}
            </div>
          </div>
        </div>
        <div className="col-md-2">
          <div className="info-data">
            <p className="font-size-14 mb-0 font-normal">Total Store</p>
            <div className="info-numbers">
              {formatThousands(
                props.inventoryInfoData.data && props.inventoryInfoData.data.totalStore
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default InventoryInfo;
